import React from'react';
import {Card,CardBody,CardText,CardTitle} from 'reactstrap';

const Contact=()=>{
    return(
        <div>
         <Card>
             <CardTitle className="text-center">Contact Us</CardTitle>
            <CardBody>
            <CardText>If you have any doubt, then immmidiately Contact with us without any hegitation...</CardText>
                <p className="lead">`Mobile: 9124081457
                                    mail: soumya.pati02@gmail.com`
                                    </p>
            </CardBody>
        </Card>
        </div>
    )
}
export default Contact;
